node.text:
I was a smaller size when these photos were taken. But honestly, it’s because of photos like these with women like them, that I feel good and beautiful changing sizes. 
(Even if other times sometimes I feel bad about it too, it’s a lot of both ya know?). 

I’m not saying anyone owes the world their bodies. 
But for those who I’ve had the honour to witness as they show up, beautifully so, or just with the knowledge that we are DESIGNED to be different, designed to change, designed to wear life and clothes and whatnot differently? 

Well, it helped. A lot. 

I came onto social media lonely and seeking connection. 

I came into weight loss thinking the way to connection was by pleasing the world with my shrinking body. 

I stay on social media for those who helped me contradict that. 

Perhaps to leave the room maybe just a little bit better than we found it. 

Thank you friends🤍

@arielleestoria your words always ground me, I share them often because they beat within my chest, often. Gives me chills. Thank you. 
@kristinazias you help me dress my postpartum body, and dress in general! To show that style is such an expression of self. Thank you. 
@raeannlangas you are always so helpful and joy-filled and present. So many times you’ve been amazing at advice like how to do a dang transition. Thank you. 
@choosingchelsea we had lunch once wondering if we would ever have babies again, here we are. I’m so glad we are doing it together, and how you encourage me. Thank you. 
@fittybritttty thank you for being someone who shows joyful movement and a life after the after photos. It means a lot. Thank you. 

@jelau_photography when we took these photos I don’t think any of us realized the echo effect they would have in this “room”. You championed us that day, and continue to. Thank you.
